import React from 'react';
import './App.css';
import ListComponent from './components/ListComponent.js';

function TitleComponent() {
  return (
    <div className="Header">
      <h1>My List Invoice</h1>
    </div>
  )
}


function App() {
  return (
    <div>
      <TitleComponent />
      <ListComponent />
    </div>
  );
}

export default App;
